            var cancelButton = data.footer.cancelButton
                ? '    <button type="button" class="btn btn-labeled bg-' + COLOR.secundary + '" ' + closeModal + " > <b><i class=\"icon-cross2\"></i></b>" + cancelText + "</button>" : "";
